    false,nt"url": null,nt"notes": "This annual narrative report for Windom
    Wetland Management District summarizes activities during the 2004 calendar year.
     The report begins with an introduction to the District and a summary of the yearu2019s
    highlights, personnel, and climatic conditions.  Information about monitoring and
    studies- including surveys and censuses- is provided next.  Habitat restoration
    and management projects are also covered; activities include water level management,
    grazing, farming, fire management, and vegetation control.  Fish and wildlife management
    is discussed next with emphasis on reintroductions, nest structures, and pest control.
     Coordination activities, such as interagency coordination, private land activities,
    and cooperative organizations, are outlined.  The resource protection section provides
    information about law enforcement, permits, water rights, cultural resource management,
    land acquisition support, threats, and conflicts.  Information about public education
    and recreation is given.  Finally, District planning and administration- including
    comprehensive conservation planning and general administration- are discussed.",nt"license_title":
